import React from "react";
import "./home.css"
import { Punjabi, Roti, Gujrati, Chinese } from "./Apimenu";
import { NavLink } from "react-router-dom";
const Ourmenu = () => {
  const show=()=>{
console.log("i am clicked")
  }
  const button = document.querySelectorAll(".btn ul li button")
  const subCart = document.querySelectorAll(".box .menu")
  button.forEach((btn) => {
  
    btn.addEventListener('click', function (e) {          
      let btnValue = e.target.textContent;      
      for (let i = 0; i <=subCart.length; i++) {    
        
        if (subCart[i].classList.contains(btnValue)) {
          subCart[i].classList.remove("active")   
          
        } else {
          subCart[i].classList.add("active")  
                  
        }
        if (btnValue == "View all") {
          subCart[i].classList.remove("active")
        }
        button[i].classList.remove("active")  
        e.target.classList.add("active")
      }  
    });
  }); 
  return (
    <>
      <section className="Ourmenu-section">
        <div className="container">
          <div className="row">
            <div className="border">
            </div>
            <div className="content">
              <div className="heading">
                <span>special selection</span>
                <h2>our menu</h2>
              </div>
              <div className="main-box">
              <div className="btn" id="br=">
                    <ul className="flex">
                      <li className="flex"><button className="active" onClick={show}>punjabi</button></li>
                      <li className="flex"><button onClick={show}>chinese</button></li>
                      <li className="flex"><button onClick={show}>roti</button></li>
                      <li className="flex"><button onClick={show}>gujrati</button></li>
                    </ul>
                  </div>
                <div className="box">                 
                  <ul className="menu punjabi flex">
                    {
                      Punjabi.map((data) => {
                        const { id, name, price } = data
                        return (
                          <li key={id}><NavLink className="flex"><h2>{name}</h2><span>{price}</span></NavLink></li>
                        )
                      })
                    }
                  </ul>
                  <ul className="menu chinese flex">
                    {
                      Chinese.map((data) => {
                        const { id, name, price } = data
                        return (
                          <li key={id}><NavLink className="flex"><h2>{name}</h2><span>{price}</span></NavLink></li>
                        )
                      })
                    }
                  </ul>
                  <ul className="menu roti flex">
                    {
                      Roti.map((data) => {
                        const { id, name, price } = data
                        return (
                          <li key={id}><NavLink className="flex"><h2>{name}</h2><span>{price}</span></NavLink></li>
                        )
                      })
                    }
                  </ul>
                  <ul className="menu gujrati flex">
                    {
                      Gujrati.map((data) => {
                        const { id, name, price } = data
                        return (
                          <li key={id}><NavLink className="flex"><h2>{name}</h2><span>{price}</span></NavLink></li>
                        )
                      })
                    }
                  </ul>
                </div>
              </div>
            </div>
          </div>
        </div>
      </section>
    </>
  );
}
export default Ourmenu;
